import React from 'react'

function Form() {

    return (
        <form className = "container">
            <div className = "header">
                <h1>Registration Form</h1>
            </div>

            <div>
                <input type="text" placeholder = "Enter your name: " name = "name" />
            </div>

        </form>
    )
}

export default Form;
